---
# 记得核对这些函数是否合适以及有没有新加的，毕竟是粗暴移植的
type: preprocessor
tune_mode: pipeline_params
pipeline_tuning_top_k: 3
parameter_tuning_freq_n: 20
pipeline:
  - type: filter.gene
    include:
      - FilterGenesScanpyOrder
      - FilterGenesPlaceHolder
      - FilterGenesPercentile
    params:
      mod: mod1
    default_params:
      FilterGenesScanpyOrder:
        order: [min_counts, max_counts, min_cells, max_cells]
        min_counts: 0.01
        max_counts: 0.99
        min_cells: 0.01
        max_cells: 0.99
  - type: filter.gene
    include:
      - FilterGenesScanpyOrder
      - FilterGenesPlaceHolder
      - FilterGenesPercentile
    params:
      mod: mod2
    default_params:
      FilterGenesScanpyOrder:
        order: [min_counts, max_counts, min_cells, max_cells]
        min_counts: 0.01
        max_counts: 0.99
        min_cells: 0.01
        max_cells: 0.99
  - type: misc
    target: AlignMod
  - type: normalize
    include: [NormalizePlaceHolder, tfidfTransform]
    params:
      mod: mod1
  - type: normalize
    include: [NormalizePlaceHolder, tfidfTransform]
    params:
      mod: mod2
  - type: normalize
    include:
      - NormalizePlaceHolder
      - ColumnSumNormalize
      - ScTransform
      - Log1P
      - NormalizeTotal
      - NormalizeTotalLog1P
    params:
      mod: mod1
    default_params:
      ScTransform:
        processes_num: 8
  - type: normalize
    include:
      - NormalizePlaceHolder
      - ColumnSumNormalize
      - ScTransform
      - Log1P
      - NormalizeTotal
      - NormalizeTotalLog1P
    params:
      mod: mod2
    default_params:
      ScTransform:
        processes_num: 8
  - type: filter.gene
    include:
      - HighlyVariableGenesLogarithmizedByMeanAndDisp
      - HighlyVariableGenesRawCount
      - FilterGenesNumberPlaceHolder
      - HighlyVariableGenesLogarithmizedByTopGenes
      - FilterGenesTopK
      - FilterGenesRegression
    params:
      mod: mod1
      channel: counts
      channel_type: layers
    default_params:
      FilterGenesTopK:
        num_genes: 3000
      FilterGenesRegression:
        num_genes: 3000
      HighlyVariableGenesRawCount:
        n_top_genes: 3000
      HighlyVariableGenesLogarithmizedByTopGenes:
        n_top_genes: 3000
  - type: filter.gene
    include:
      - HighlyVariableGenesLogarithmizedByMeanAndDisp
      - HighlyVariableGenesRawCount
      - FilterGenesNumberPlaceHolder
      - HighlyVariableGenesLogarithmizedByTopGenes
      - FilterGenesTopK
      - FilterGenesRegression
    params:
      mod: mod2
      channel: counts
      channel_type: layers  # all inplace
    default_params:
      FilterGenesTopK:
        num_genes: 3000
      FilterGenesRegression:
        num_genes: 3000
      HighlyVariableGenesRawCount:
        n_top_genes: 3000
      HighlyVariableGenesLogarithmizedByTopGenes:
        n_top_genes: 3000
  - type: filter.cell
    include: [FilterCellsScanpyOrder, FilterCellsPlaceHolder]
    params:
      mod: mod1
    default_params:
      FilterCellsScanpyOrder:
        order: [min_counts, min_genes, max_counts, max_genes]
        min_counts: 0.01
        max_counts: 0.99
        min_genes: 0.01
        max_genes: 0.99
  - type: filter.cell
    include: [FilterCellsScanpyOrder, FilterCellsPlaceHolder]
    params:
      mod: mod2
    default_params:
      FilterCellsScanpyOrder:
        order: [min_counts, min_genes, max_counts, max_genes]
        min_counts: 0.01
        max_counts: 0.99
        min_genes: 0.01
        max_genes: 0.99
  - type: filter.cell
    target: FilterCellsCommonMod
    params:
      mod1: mod1
      mod2: mod2
      sol: test_sol
  - type: filter.cell
    include: [FilterCellsScanpyOrder, FilterCellsPlaceHolder]
    params:
      mod: meta1
    default_params:
      FilterCellsScanpyOrder:
        order: [min_counts, min_genes, max_counts, max_genes]
        min_counts: 0.01
        max_counts: 0.99
        min_genes: 0.01
        max_genes: 0.99
  - type: filter.cell
    include: [FilterCellsScanpyOrder, FilterCellsPlaceHolder]
    params:
      mod: meta2
    default_params:
      FilterCellsScanpyOrder:
        order: [min_counts, min_genes, max_counts, max_genes]
        min_counts: 0.01
        max_counts: 0.99
        min_genes: 0.01
        max_genes: 0.99
  - type: filter.cell
    target: FilterCellsCommonMod
    params:
      mod1: meta1
      mod2: meta2
  - type: feature.cell
    include:
      # - CellPCA
      # - CellSVD
      # - GaussRandProjFeature
      # - WeightedFeaturePCA
      # - WeightedFeatureSVD
      - FeatureCellPlaceHolder
    params:
      out: feature.cell
      log_level: INFO
      mod: mod1
    # default_params:
    #   CellPCA:
    #     n_components: 400
    #   CellSVD:
    #     n_components: 400
    #   GaussRandProjFeature:
    #     n_components: 400
    #   WeightedFeaturePCA:
    #     n_components: 400
    #   WeightedFeatureSVD:
    #     n_components: 400
  - type: feature.cell
    include:
      # - CellPCA
      # - CellSVD
      # - GaussRandProjFeature
      # - WeightedFeaturePCA
      # - WeightedFeatureSVD
      - FeatureCellPlaceHolder
    params:
      out: feature.cell
      log_level: INFO
      mod: mod2
    # default_params:
    #   CellPCA:
    #     n_components: 400
    #   CellSVD:
    #     n_components: 400
    #   GaussRandProjFeature:
    #     n_components: 400
    #   WeightedFeaturePCA:
    #     n_components: 400
    #   WeightedFeatureSVD:
    #     n_components: 400
  - type: misc
    target: SetConfig
    params:
      config_dict:
        feature_mod: [mod1, mod2, mod1, mod2, mod1, mod2]
        label_mod: mod1
        feature_channel_type: [obsm, obsm, layers, layers, obsm, obsm]
        feature_channel:
          - feature.cell
          - feature.cell
          - counts
          - counts
          - size_factors
          - size_factors
        label_channel: labels
